    {pilot: 'Duo', mechs: ['Heavy Arms', 'Heavy Arms 2']}, 
    {pilot: 'Miliardo', mechs: ['Tallgeese', 'Tallgees 00']}, 
]

const GundamIteration =()=>(
       <>
      {gundamArrays.map((pil) => (
        <ul key={pil.pilot}>the Pilot: {pil.pilot} {pil.mechs.map(gund=><li>{gund}</li>)}</ul>
      ))}
    </>

)

